const _hoisted_6 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>True Name: Artoria Pendragon (Lily)</li><li>Class: Saber</li><li>Source: Arthurian cycle</li><li>Region: England</li><li>Gender: Female</li><li>Alignment: Lawful Good</li><li>Height: 154 cm</li><li>Weight: 42 kg</li></ul><p><strong>Meta</strong></p><ul><li>Character Creator: Nasu Kinoko</li><li>Character Illustrator: Takeuchi Takashi</li><li>Character Voice: Kawasumi Ayako</li><li>Appearance in Main Works: Fate/Unlimited Codes</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">A</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">A+</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">B</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Magic Resistance: [E]</strong></p><p>No matter what large spell, magecraft lower than B is nullified.</p><p>Since the draconian heart hasn\u2019t awakened yet, it\u2019s been reduced one rank from the grown-up Artoria.</p><p><strong>Riding: [C]</strong></p><p>If it\u2019s been trained and adjusted properly, she can ride it perfectly.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Instinct: [B]</strong></p><p>Ability to always \u201Cfeel\u201D the most suitable course of action for oneself in battle.</p><p>A sharpened sixth sense that is already close to future sight.</p><p>Halves interference blocking vision/hearing.</p><p>However, intuition is also a thought. Anyways, since she feels sensitive to the troubles of people, when she encounters people, she\u2019ll help them.</p><p><strong>Mana Burst: [A]</strong></p><p>By wrapping weapons, or the own body, with mana, and releasing it, allows to temporarily increase abilities.</p><p>In other words, it\u2019s jet propulsion with mana. This Heroic Spirit applies it in sword fights for defense and movement, demonstrating high performance in every aspect.</p><p><strong>Blossoming Journey: [EX]</strong></p><p>A blessing (Gift) for the girl knight that started walking the path to kingship.</p><p>That road is filled with hope, making the hearts of those who fight along her positive.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="caliburn-golden-sword-of-assured-victory" tabindex="-1"><a class="header-anchor" href="#caliburn-golden-sword-of-assured-victory" aria-hidden="true">#</a> Caliburn: Golden sword of assured victory</h1><ul><li>Rank: B (Conditionally A+)</li><li>Type: Anti-Unit Noble Phantasm</li><li>Range: 1~30</li><li>Max. Targets: \u2013</li></ul><p>Caliburn.</p><p>Originally a sword to select the king. The \u300EAnti-Unit\u300F of Anti-Unit Noble Phantasm isn\u2019t aimed to the enemy, but to the current owner.</p><p>When that proprietor is corrected and completed as a king, its power will become suitable for a holy sword.</p><p>Despite being inferior to Excalibur, this holy sword also converts the user\u2019s mana into heat values, releasing it as particles of light.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><ul><li>First Person: \u79C1 (watashi)</li><li>Second Person: \u8CB4\u65B9 (anata) / \u8CB4\u69D8 (kisama) / \u8CB4\u516C (kik\u014D) / \u3007\u3007 (without honorifics)</li><li>Third Person: \u5974 (yatsu) / \u5974\u7B49 (yatsura) / \u3007\u3007 (without honorifics)</li></ul><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>An Artoria that has pulled the Sword of Selection and began walking the path to kingship. A what-if.</p><p>Honest, positive, does everything with utmost effort.</p><p>Her being a rather unconfident late bloomer since she\u2019s aware that she\u2019s still half-baked is the fly in the ointment.</p><p>Pleasantly happy and joyful when having fun,</p><p>saying straightforwardly that sad things are sad, the shape of a young girl that wasn\u2019t allowed to the original Artoria.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>With a \u201CSince I was called as a Heroic Spirit I\u2019ll serve Master with all my strength!\u201D, she expresses motivation and joy through her whole body.</p><p>She trusts her Master and doesn\u2019t hesitate if she thinks the fight is good. She doesn\u2019t think at all about a reward for herself.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><ul><li><p>\u300ENice to meet you, Master. Since I\u2019m still a half-baked knight, please call me Saber Lily. From now on, thanks for your continued support.\u300F</p></li><li><p>\u300EI-is that so\u2026\u2026 I think that A rank is an exaggeration\u2026 But, I\u2019m happy with flattery. When Master says that, my self-confidence springs out!\u300F</p></li><li><p>\u300EMaster is still growing too. I\u2019m glad to somehow have made a friend. Fufu. It\u2019s a competition about who will become an adult first.\u300F</p></li><li><p>\u300EAnd \u2015\u2015 This holy sword (sword) shines to protect the loved ones! Ready your sword, Heroine Z\u2026\u2026! Saber Lily will lead you to death!\u300F</p></li></ul><h2 id="character-in-fgo" tabindex="-1"><a class="header-anchor" href="#character-in-fgo" aria-hidden="true">#</a> Character in FGO</h2><p>The appearance of Artoria after pulling the Sword of Selection and just having begun walking the path as a king. Still a half-baked knight girl.</p><p>That appearance is like a lovely lily and those eyes are filled with bright hope.</p><p>Wandering around the country in order to experience lots of things, she left behind many adventures. Those who were helped by her seemed to praise her as a knight princess for her gorgeousness.</p><p>A romantic knight that, in order to become an ideal king, studies every day.</p><p>Since she\u2019s still half an adult that can\u2019t sweep away her girlishness, that heart and those dreams are still filled with hope.</p><p>The tour round the country with the party consisting on her stepbrother Sir Kay and her retainer, the mage Merlin, usually started with Artoria\u2019s meddling, became a big deal with Merlin\u2019s jeering, and ended with Kay wiping her buttocks.</p><p>The leading Servant of the special event \u300ESaber Wars\u300F.</p><p>Having set up the \u300Ealliance of undeveloped Noble Phantasms\u300F with Mash, she admirably devoted herself to practice in order to raise the power of her Noble Phantasm.</p><p>Studying under the mysterious Servant that called herself Saber among Sabers, Heroine X, she fought fierce battles against the strange Servants that kept attacking one after another.</p><p>What about the Artorium? What about the Servant Universe? What about Heroine X\u2019s hidden goal?</p><p>Saber Lily\u2019s fight has just begun! To Be Continued! (\u203B This has absolutely nothing to do with the Arthurian cycle)</p><h2 id="interlude-1-clear-profile" tabindex="-1"><a class="header-anchor" href="#interlude-1-clear-profile" aria-hidden="true">#</a> Interlude 1 Clear Profile</h2><p>Caliburn and Excalibur are different sacred swords.</p><p>Caliburn nurtures royalty, and raises Arthur into a king. Originally, Caliburn was used for ceremonies.</p><p>Using this as a weapon by releasing its True Name can exert the same firepower as Excalibur, but the sword will not be able to withstand Artoria&#39;s magical energy and will likely disintegrate.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Mysterious Heroine X</strong></p><p>Despite the difference in style of acting and worldview, she respects her as a teacher of the sword.</p><p><strong>Merlin</strong></p><p>The masked pretty boy that gallantly appears when Saber Lily is in a pinch. His identity is still shrouded by mystery.</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>It\u2019s a basic rule of evolutionary designs that equipment and decorations become more luxurious, but there are also some characters like Lily that become more lightly dressed.</p><p>Although I liked Lily\u2019s design from the start, I liked even more fully the mini-skirt dress of the third Ascension. (Takeuchi Takashi)</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-034.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-035.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-036.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-037.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-038.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-038.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-040.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-041.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;">It is nice to meet you Master. Since I am still in training, please call me Saber Lily.It is a pleasure to meet you.</td><td style="text-align:center;">\u300C\u306F\u3058\u3081\u307E\u3057\u3066\u30DE\u30B9\u30BF\u30FC\u3002\u307E\u3060\u534A\u4EBA\u524D\u306E\u5263\u58EB\u306A\u306E\u3067\u3001\u30BB\u30A4\u30D0\u30FC\u30FB\u30EA\u30EA\u30A3\u3068\u304A\u547C\u3073\u304F\u3060\u3055\u3044\u3002\u3053\u308C\u304B\u3089\u3001\u672B\u6C38\u304F\u3088\u308D\u3057\u304F\u304A\u9858\u3044\u3057\u307E\u3059\u3002\u300D</td></tr><tr><td style="text-align:left;">Bond 1</td><td style="text-align:center;">I&#39;m still training. I haven&#39;t achieved anything worthy to be called a Heroic Spririt, but I will do my best as a Saber.</td><td style="text-align:center;">\u300C\u79C1\u306F\u307E\u3060\u4FEE\u884C\u4E2D\u306E\u8EAB\u3002\u82F1\u970A\u3068\u547C\u3070\u308C\u308B\u307B\u3069\u5049\u696D\u306F\u6210\u3057\u3048\u3066\u3044\u307E\u305B\u3093\u304C\u3001\u7CBE\u4E00\u676F\u3001\u30BB\u30A4\u30D0\u30FC\u3068\u3057\u3066\u52AA\u3081\u3055\u305B\u3066\u3044\u305F\u3060\u304D\u307E\u3059\u300D</td></tr><tr><td style="text-align:left;">Bond 2</td><td style="text-align:center;">You&#39;re still growing, too, Master. That&#39;s why it feels like I just gained a friend. Hehe, let&#39;s see who ends up being the best.</td><td style="text-align:center;">\u300C\u30DE\u30B9\u30BF\u30FC\u3082\u3001\u307E\u3060\u307E\u3060\u6210\u9577\u4E2D\u306A\u306E\u3067\u3059\u306D\u3002\u306A\u3093\u3060\u304B\u53CB\u4EBA\u304C\u51FA\u6765\u305F\u3088\u3046\u3067\u5B09\u3057\u3044\u3067\u3059\u3002\u3075\u3075\u3075\u3063\u3001\u3069\u3061\u3089\u304C\u5148\u306B\u4E00\u4EBA\u524D\u306B\u306A\u308B\u304B\u3001\u7AF6\u4E89\u3067\u3059\u306D\u3063\u300D</td></tr><tr><td style="text-align:left;">Bond 3</td><td style="text-align:center;">I&#39;m still working on my swordsmanship and have a long way to go to become a knight. It&#39;s not just about skills, but mental fortitude as well. One day, I will have the strength worthy of the Sword.</td><td style="text-align:center;">\u300C\u79C1\u306F\u307E\u3060\u5263\u58EB\u898B\u7FD2\u3044\u3067\u3001\u9A0E\u58EB\u306E\u4F4D\u304F\u3089\u3044\u306B\u306F\u7A0B\u9060\u3044\u3067\u3059\u2026\u2026\u3002\u6280\u91CF\u3082\u305D\u3046\u3067\u3059\u304C\u3001\u7CBE\u795E\u304C\u307E\u3060\u935B\u3048\u3089\u308C\u3066\u3044\u307E\u305B\u3093\u3002\u3044\u3064\u304B\u5FC5\u305A\u3001\u3053\u306E\u8056\u5263\u306B\u76F8\u5FDC\u3057\u3044\u5FC3\u306E\u5F37\u3055\u3092\u624B\u306B\u5165\u308C\u307E\u3059\u300D</td></tr><tr><td style="text-align:left;">Bond 4</td><td style="text-align:center;">Umm... I know I said &quot;long time to come&quot; when you first summoned me, but I really didn&#39;t think we&#39;d get this close. Now, your presence alone is enough to give me strength, Master.</td><td style="text-align:center;">\u300C\u3048\u3063\u3068\u2026\u2026\u53EC\u559A\u6642\u306B\u672B\u6C38\u304F\u3001\u3068\u306F\u8A00\u3044\u307E\u3057\u305F\u304C\u3001\u3053\u3093\u306A\u306B\u89AA\u8EAB\u306B\u306A\u3063\u3066\u304F\u308C\u308B\u3068\u306F\u601D\u3063\u3066\u3044\u307E\u305B\u3093\u3067\u3057\u305F\u3002\u4ECA\u306F\u3001\u3042\u306A\u305F\u304C\u8EAB\u8FD1\u306B\u3044\u3066\u304F\u308C\u308B\u3060\u3051\u3067\u529B\u304C\u6E67\u3044\u3066\u304D\u307E\u3059\u3001\u30DE\u30B9\u30BF\u30FC\u300D</td></tr><tr><td style="text-align:left;">Bond 5</td><td style="text-align:center;">I&#39;m grateful, Master. I may still be immature, but now I know the difference between what I should protect and what I want to protect. Oh? You feel the same? Hehe. It&#39;s like we&#39;re reading each other&#39;s minds. Someday I will part ways with this sword, but please fight with me until then, Master.</td><td style="text-align:center;">\u300C\u8CB4\u65B9\u306B\u611F\u8B1D\u3092\u3001\u30DE\u30B9\u30BF\u30FC\u3002\u534A\u4EBA\u524D\u3060\u3063\u305F\u79C1\u3067\u3059\u304C\u3001\u4ECA\u306F\u5B88\u308B\u3079\u304D\u3082\u306E\u3068\u3001\u5B88\u308A\u305F\u3044\u3082\u306E\u306E\u9055\u3044\u304C\u5206\u304B\u308A\u307E\u3057\u305F\u3002\u2026\u2026\u3048\uFF1F \u81EA\u5206\u3082\u540C\u3058\u3001\u3067\u3059\u304B\uFF1F \u3075\u3075\u2026\u2026\u4EE5\u5FC3\u4F1D\u5FC3\u3068\u3044\u3046\u3084\u3064\u3067\u3059\u306D\u3002\u3044\u3064\u304B\u3053\u306E\u5263\u306F\u5931\u308F\u308C\u307E\u3059\u304C\u3001\u305D\u308C\u307E\u3067\u3069\u3046\u304B\u5171\u306B\u6226\u308F\u305B\u3066\u4E0B\u3055\u3044\u3001\u30DE\u30B9\u30BF\u30FC\u300D</td></tr><tr><td style="text-align:left;">Dialogue 1</td><td style="text-align:center;">Resting too much isn&#39;t good for you, Master. So let&#39;s work hard again today!</td><td style="text-align:center;"></td></tr><tr><td style="text-align:left;">Dialogue 2</td><td style="text-align:center;">You speak of kings and retainers? Th-That&#39;s not happening anytime soon, and I&#39;m not prepared in the slightest... S-Sorry!</td><td style="text-align:center;">\u300C\u738B\u3068\u81E3\u4E0B\u306E\u8A71\u3067\u3059\u304B\uFF1F \u305D\u3001\u305D\u306E\u3001\u307E\u3060\u5C06\u6765\u306E\u8A71\u306A\u306E\u3067\u3001\u79C1\u81EA\u8EAB\u3001\u5168\u7136\u899A\u609F\u304C\u3067\u304D\u3066\u3044\u306A\u3044\u3068\u3044\u3046\u304B\u2026\u2026\u3059\u3001\u3059\u307F\u307E\u305B\u3093\uFF01\u300D</td></tr><tr><td style="text-align:left;">Dialogue 3</td><td style="text-align:center;">I am currently training. I will learn by your side, Master.</td><td style="text-align:center;">\u300C\u79C1\u306F\u4FEE\u884C\u4E2D\u306E\u8EAB\u3067\u3059\u304B\u3089\u3002\u30DE\u30B9\u30BF\u30FC\u306E\u4E0B\u3082\u3068\u3001\u52C9\u5F37\u3055\u305B\u3066\u3044\u305F\u3060\u304D\u307E\u3059\u300D</td></tr><tr><td style="text-align:left;">Dialogue 4 (Medea Lily)</td><td style="text-align:center;">That person who&#39;s wearing that pretty violet outfit over there... Oh, so her name is Medea. I somehow feel closeness to her. And her title as a friendly witch is also lovely! Surely she must be a gentle and delicate person. There&#39;s no doubt she&#39;ll grow up to be a wonderful lady! yep! There&#39;s no way she would annoyingly curse enemies from afar.</td><td style="text-align:center;">\u300C\u3042\u3061\u3089\u306E\u3001\u83EB\u3059\u307F\u308C\u8272\u306E\u7D20\u6575\u306A\u670D\u88C5\u306E\u65B9\u2026\u2026\u30E1\u30C7\u30A3\u30A2\u3055\u3093\u3001\u3068\u3044\u3046\u306E\u3067\u3059\u306D\u3002\u4F55\u6545\u304B\u3001\u89AA\u3057\u3044\u3082\u306E\u3092\u611F\u3058\u307E\u3059\u3002\u300E\u4EF2\u826F\u3057\u306E\u9B54\u5973\u300F\u3068\u3044\u3046\u79F0\u53F7\u3082\u3001\u611B\u3089\u3057\u3044\u3067\u3059\u3002\u304D\u3063\u3068\u3001\u3068\u3066\u3082\u7A4F\u3084\u304B\u3067\u7E4A\u7D30\u306A\u65B9\u306A\u306E\u3067\u3057\u3087\u3046\u3002\u5C06\u6765\u306F\u7D20\u6575\u306A\u30EC\u30C7\u30A3\u9593\u9055\u3044\u306A\u3057\uFF01 \u3067\u3059\u306D\uFF01 \u9060\u304F\u304B\u3089\u30C1\u30AF\u30C1\u30AF\u6575\u3092\u546A\u3046\u3068\u304B\u3001\u3042\u308A\u5F97\u307E\u305B\u3093\uFF01\u300D</td></tr><tr><td style="text-align:left;">Dialogue 5 (Mysterious Heroine X)</td><td style="text-align:center;">Thanks to Master X and Master, I&#39;ve gotten confident with my Noble Phantasm! One of these days I&#39;ll visit the Universe and eradicate all the evil Sabers with Master X!</td><td style="text-align:center;">\u300C\uFF38\u5E2B\u5320\u3068\u30DE\u30B9\u30BF\u30FC\u306E\u304A\u304B\u3052\u3067\u3001\u79C1\u3082\u81EA\u5206\u306E\u5B9D\u5177\u306B\u81EA\u4FE1\u304C\u6301\u3066\u307E\u3057\u305F\u3002\u3044\u3064\u304B\u304D\u3063\u3068\u30E6\u30CB\u30F4\u30A1\u30FC\u30B9\u306B\u304A\u90AA\u9B54\u3057\u3066\u3001\uFF38\u5E2B\u5320\u3068\u4E00\u7DD2\u306B\u60AA\u306E\u30BB\u30A4\u30D0\u30FC\u3092\u3084\u3063\u3064\u3051\u305F\u3044\u3068\u601D\u3044\u307E\u3059\u300D</td></tr><tr><td style="text-align:left;">Something you Like</td><td style="text-align:center;">Things that I like? Well, I like village festivals and grooming horses. I know I have to forget about all that, but I doubt I ever will.</td><td style="text-align:center;">\u300C\u597D\u304D\u306A\u3082\u306E\u2026\u2026\u6751\u306E\u796D\u308A\u3084\u3001\u99AC\u306E\u4E16\u8A71\u3067\u3059\u306D\u3002\u672C\u5F53\u306A\u3089\u5FD8\u308C\u306A\u304F\u3066\u306F\u3044\u3051\u306A\u3044\u306E\u3067\u3059\u304C\u3001\u3069\u3046\u3082\u4E00\u751F\u5FD8\u308C\u3089\u308C\u305D\u3046\u306B\u306A\u304F\u3066\u2026\u2026\u300D</td></tr><tr><td style="text-align:left;">Something you Hate</td><td style="text-align:center;">Things I hate? There isn&#39;t any...but there is something I&#39;m bad at. I&#39;m great at dancing with women but can&#39;t dance with men for the life of me...</td><td style="text-align:center;">\u300C\u5ACC\u3044\u306A\u3082\u306E\u3001\u306F\u3042\u308A\u307E\u305B\u3093\u304C\u3001\u82E6\u624B\u306A\u3082\u306E\u304C\u3072\u3068\u3064\u3002\u540C\u6027\u3068\u306E\u30C0\u30F3\u30B9\u306F\u5F97\u610F\u306A\u306E\u3067\u3059\u304C\u3001\u6BBF\u65B9\u3068\u306E\u30C0\u30F3\u30B9\u306F\u3001\u3069\u3046\u3082\u52DD\u624B\u304C\u9055\u3063\u3066\u2026\u2026\u300D</td></tr><tr><td style="text-align:left;">About the Holy Grail</td><td style="text-align:center;">A Holy Grail that grants wishes you say? Such a thing would certainly come in handy.</td><td style="text-align:center;">\u300C\u9858\u3044\u306E\u53F6\u3046\u8056\u676F\u2026\u2026\u3067\u3059\u304B\uFF1F \u78BA\u304B\u306B\u305D\u3093\u306A\u30E2\u30CE\u304C\u3042\u308B\u306E\u306A\u3089\u3001\u4FBF\u5229\u3067\u3059\u306D\u300D</td></tr></tbody></table>', 81);
